import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <nav nameClass="navbar bg-light">
        <div nameClass="container">
          <a nameClass="navbar-brand" href="#">
            <img src="./logo/logo_appfisio.png" alt="Bootstrap" width="30" height="24" />
          </a>
        </div>
      </nav>
    </div>
  );
}

export default App;
